import React from "react";
import "./ListItem.css"

const ListItem = (props) => {
    return (
        <ul className>
        <li id={Math.round(Math.random()*100000*Math.random())} className={`goal-form-item`} >{props.adat.name}</li>
        <li id={Math.round(Math.random()*100000*Math.random())} className={`goal-form-item`} >{props.adat.name}</li>
        </ul>
    )
}

export default ListItem
